Καλημερα θα μπορούσαμε να προβούμε σε ακύρωση της αναβάθμισης;
Δεν μου ήτανε ξεκάθαρο η χρέωση ως εφάπαξ ποσό και όχι σε μηνιαία χρέωση.
Ευχαριστώ εκ των προτέρων

Θα ήθελα να χρησιμοποιήσω την εφαρμογή στο κατάστημα που δουλεύω 
Μπορώ;
 και εάν θυμάμαι  καλά είναι χωρίς χρονικό όριο σωστά ;
